import{_ as r,c as t,o as a,d as n}from"./app.6898ed50.js";const f=JSON.parse('{"title":"DT hj\xE4rna","description":"","frontmatter":{},"headers":[{"level":2,"title":"Fr\xE5gest\xE4llningar","slug":"fragestallningar"}],"relativePath":"dt-hjarna.md","lastUpdated":1662669856000}'),e={name:"dt-hjarna.md"},i=n('<h1 id="dt-hjarna" tabindex="-1">DT hj\xE4rna <a class="header-anchor" href="#dt-hjarna" aria-hidden="true">#</a></h1><p>DT hj\xE4rna \xE4r en nativ unders\xF6kning utan kontrast.</p><div class="tip custom-block"><p class="custom-block-title">Normalfynd</p><p>Ingen bl\xF6dning, avgr\xE4nsbar infarkt, fraktur i neurokraniet eller expansivitet. Normalvida likvorrum. Op\xE5verkade basala cisterner. Luftf\xF6rande sinus och mastoidceller.</p></div><div class="warning custom-block"><p class="custom-block-title">Indikation</p><ul><li>Skalltrauma (kombinera \xE4ven med DT halsrygg)</li><li>Stroke</li><li>Krampanfall</li><li>Oklar medvetandep\xE5verkan.</li></ul></div><h2 id="fragestallningar" tabindex="-1">Fr\xE5gest\xE4llningar <a class="header-anchor" href="#fragestallningar" aria-hidden="true">#</a></h2><div class="info custom-block"><p class="custom-block-title">Exempel</p><ol><li>Bl\xF6dning?</li><li>Infarkt? / Demarkerad infarkt?</li><li>Skelettskada?</li><li>Expansivitet?</li><li>Hydrocefalus?</li><li>Degenerativa f\xF6r\xE4ndringar?</li><li>F\xF6rlopps-DT?</li></ol></div><br><table><thead><tr><th>Fr\xE5gest\xE4llning</th><th>Tillst\xE5nd</th><th>Kommentar</th></tr></thead><tbody><tr><td><b>Bl\xF6dning?</b></td><td><u>Intrakraniell bl\xF6dning</u><br>Hemorragisk stroke eller traumatisk bl\xF6dning:<br><br>- Epiduralbl\xF6dning<br>- Subduralhematom<br>- Subaraknoidalbl\xF6dning<br>- Intracerebral bl\xF6dning<br>- Kontusionsbl\xF6dning</td><td><u>Subaraknoidalbl\xF6dning:</u><br>- DT-hj\xE4rna om symtomdebut &lt;6h, annars os\xE4ker metod.<br>- DT-angiografi vid spontan subaraknoidalbl\xF6dning. Ingen angio vid traumatisk subaraknoidalbl\xF6dning.<br>- LP + spektrofotometri vid symtomdebut &gt;12h sedan.</td></tr><tr><td><b>Infarkt? /<br>Demarkerad infarkt?</b></td><td><u>Ischemisk stroke</u><br>F\xE4rsk eller genomg\xE5ngen infarkt:<br><br>-Cerebral infarkt<br>-Mediainfarkt<br>-PICA-infarkt etc.</td><td><u>Fynd:</u><br>- Demarkerad infarkt: synlig f\xE4rsk avgr\xE4nsbar infarkt<br>- L\xE5gattenuerat / hypodens omr\xE5de: infarktmisstanke<br>- Dense vessel sign: hyperdens blodk\xE4rl som vid f\xE4rsk infarkt<br>- Lakun\xE4r infarkt: infarkt orsakad av sm\xE5k\xE4rlssjuka<br>- Substansdefekt: t.ex. genomg\xE5ngen infarkt/bl\xF6dning</td></tr><tr><td><b>Skelettskada?</b></td><td>- Fraktur i neurokranium<br>- Skallbasfraktur<br>- N\xE4sfraktur<br>- Orbitafraktur<br>- Maxillarfraktur</td><td></td></tr><tr><td><b>Expansivitet?</b></td><td>- Tum\xF6r (malign / benign)<br>- Hj\xE4rnabscess</td><td>F\xF6r n\xE4rmare diagnostik kr\xE4vs oftast DT hj\xE4rna med kontrast.<br><br><u>Fynd:</u><br>- Perifokalt \xF6dem<br>- Kompression av ventriklar: medellinjef\xF6rskjutning<br>- Masseffekt: trycker p\xE5 omgivande strukturer<br>- Herniering: inkl\xE4mning av strukturer</td></tr><tr><td><b>Hydrocefalus?</b></td><td></td><td><u>Fynd:</u> Vida ventriklar och p\xE5verkade likvorrum.</td></tr><tr><td><b>Degenerativa f\xF6r\xE4ndringar?</b></td><td>Demenssjukdomar</td><td><u>Fynd:</u><br>- Atrofi<br>- Degenerativa vitsubstansf\xF6r\xE4ndringar<br>- Vida ventriklar<br><br>Vitsubstansf\xF6r\xE4ndringar av olika genes:<br>- Mikroangiopatiska<br>- Degenerativa<br>- Ischemiska</td></tr><tr><td><b>F\xF6rlopps-DT?</b></td><td><u>Progress/regress av:</u><br>- Bl\xF6dning<br>- Infarkt</td><td>Vid bl\xF6dning kontakta neurokirurgen f\xF6r diskussion kring handl\xE4ggning och n\xE4r kontroll-DT ska g\xF6ras. H\xE5ll patienten fastande tills dess.</td></tr></tbody></table>',8),d=[i];function l(s,o,b,k,u,g){return a(),t("div",null,d)}const c=r(e,[["render",l]]);export{f as __pageData,c as default};
